    "2016-07-27T23:05:20.126096",nt"name": "insects-collected-at-the-carolina-sandhills-national-wildlife-refuge-by-the-mississippi-en",nt"isopen":
    false,nt"url": null,nt"notes": "The Mississippi Entomological Museum (MEM)
    has been surveying the insect fauna of the southeastern United States for the last
    29 years. This ongoing research is important for documenting the regionu2019s biodiversity
    and biogeographic patterns. During the last several years the museum staff had several
    research projects involving sandhills in the Southeast and lacked data from South
    Carolina. Given the large amount of acreage and diversity of habitats available
    for sampling, Carolina Sandhills National Wildlife Refuge was deemed as an area
    of interest, and as such was selected (along with Cheraw State Park) as the destination
    of the 2013 William H. Cross expedition. During 8 - 13 July 2013, the Mississippi
    Entomological Museum surveyed several groups of insects in Carolina Sandhills National
    Wildlife Refuge. JoVonn Hill made an additional visit to the site on 17 September
    2013. Given the limited time spent in the refuge, sampling took place at only eight
    sites. (Table 1.) Sampling focused primarily on ants, blow flies, and grasshoppers.
    Species lists are provided and are annotated with the site number each species was
    collected at. All specimens are deposited in the MEM.",nt"license_title": "License
